bool AutofillManager::FindCachedForm(const FormData& form,
                                     FormStructure** form_structure) const {
  *form_structure = NULL;
  for (std::vector<FormStructure*>::const_iterator iter =
       form_structures_.begin();
       iter != form_structures_.end(); ++iter) {
    if (**iter == form) {
      *form_structure = *iter;
