xmlParseSDDecl(xmlParserCtxtPtr ctxt) {
 int standalone = -2;

    SKIP_BLANKS;
 if (CMP10(CUR_PTR, 's', 't', 'a', 'n', 'd', 'a', 'l', 'o', 'n', 'e')) {
	SKIP(10);
        SKIP_BLANKS;
 if (RAW != '=') {
	    xmlFatalErr(ctxt, XML_ERR_EQUAL_REQUIRED, NULL);
 return(standalone);
 }
	NEXT;
	SKIP_BLANKS;
 if (RAW == '\''){
	    NEXT;
 if ((RAW == 'n') && (NXT(1) == 'o')) {
	        standalone = 0;
                SKIP(2);
 } else if ((RAW == 'y') && (NXT(1) == 'e') &&
 (NXT(2) == 's')) {
	        standalone = 1;
		SKIP(3);
 } else {
		xmlFatalErr(ctxt, XML_ERR_STANDALONE_VALUE, NULL);
 }
 if (RAW != '\'') {
		xmlFatalErr(ctxt, XML_ERR_STRING_NOT_CLOSED, NULL);
 } else
	        NEXT;
 } else if (RAW == '"'){
	    NEXT;
 if ((RAW == 'n') && (NXT(1) == 'o')) {
	        standalone = 0;
		SKIP(2);
 } else if ((RAW == 'y') && (NXT(1) == 'e') &&
 (NXT(2) == 's')) {
	        standalone = 1;
                SKIP(3);
 } else {
		xmlFatalErr(ctxt, XML_ERR_STANDALONE_VALUE, NULL);
 }
 if (RAW != '"') {
		xmlFatalErr(ctxt, XML_ERR_STRING_NOT_CLOSED, NULL);
 } else
	        NEXT;
 } else {
	    xmlFatalErr(ctxt, XML_ERR_STRING_NOT_STARTED, NULL);
 }
 }
 return(standalone);
}

